patch:
diff --git a/mlir/lib/Dialect/Arith/IR/ArithOps.cpp b/mlir/lib/Dialect/Arith/IR/ArithOps.cpp
index e9545c3146b2..8a4ea3f67524 100644
--- a/mlir/lib/Dialect/Arith/IR/ArithOps.cpp
+++ b/mlir/lib/Dialect/Arith/IR/ArithOps.cpp
@@ -46,6 +46,14 @@ applyToIntegerAttrs(PatternRewriter &builder, Value res, Attribute lhs,
   APInt lhsVal = llvm::cast<IntegerAttr>(lhs).getValue();
   APInt rhsVal = llvm::cast<IntegerAttr>(rhs).getValue();
   APInt value = binFn(lhsVal, rhsVal);
+  
+  // Ensure the result APInt has the same bit width as the target type
+  if (auto intType = llvm::dyn_cast<IntegerType>(res.getType())) {
+    unsigned targetWidth = intType.getWidth();
+    if (value.getBitWidth() != targetWidth) {
+      value = value.trunc(targetWidth);
+    }
+  }
   return IntegerAttr::get(res.getType(), value);
 }
